import './App.css';

function App() {
  return (
    <div className="App">
      <User name="Adrian" age={20} email="adrian@adrian.com"/>
      <Job salary={120500} position="FrontEnd Developer" company="CCC"/>
      <User name="Mateusz" age={35} email="mateusz@mateusz.com"/>
      <Job salary={80900} position="BackEnd Developer" company="E-Obuwie"/>
      <User name="Janusz" age={47} email="janusz@janusz.com"/>
      <Job salary={45500} position="Full Stack Developer" company="CCC"/>
    </div>
  );
}
const User = (props) => {
  return(
    <div className="ViewCard">
      <h3>Name: {props.name}</h3>
      <h3>Age: {props.age}</h3> 
      <h3>E-mail: {props.email}</h3>    
    </div>
  );
}

const Job = (props) => {
  return (
    <div className="ViewCard">
      <h3>Salary: {props.salary}</h3>
      <h3>Position: {props.position}</h3>
      <h3>Company: {props.company}</h3>
    </div>
  );
}
export default App;
